import Article from "../article/article";
import * as styled from "./articlesPreviewStyles";

const ArticlesPreview = ({ articles, onLike, selectedTag }) => {
  const globalTag = () => {
    return (
      <styled.FeedTab>
        {selectedTag === undefined ? (
          <li>
            <styled.FeedLink to="#">Global Feed</styled.FeedLink>
          </li>
        ) : (
          <li>
            <styled.FeedLink to="#">Global Feed</styled.FeedLink>
            <styled.FeedLink to="#">{`#` + selectedTag}</styled.FeedLink>
          </li>
        )}
      </styled.FeedTab>
    );
  };

  return (
    <div>
      <globalTag />
      {articles.map((article) => (
        <Article
          key={article.slug}
          article={article}
          onClick={onLike(article)}
        ></Article>
      ))}
    </div>
  );
};

export default ArticlesPreview;
